extension CharacterDetailView.Action {
    var feature: CharacterDetailAction {
        switch self {
        case .onAppear:
            return .onAppear
        case let .setSelectedCharacter(url):
            return .setSelectedCharacter(url: url)
        case let .setSelectedHouse(url):
            return .setSelectedHouse(url: url)
        }
    }
}
